import React from "react";
import InstagramEmbed from "react-instagram-embed";
const list = [
  {
    Cliente: "Villas del María",
    URL: "https://www.instagram.com/p/B7pJj5Dhwjs/"
  }
];
export default class instagram extends React.Component {
  render() {
    // const { column } = this.props;
    return (
      <div>
        <React.Fragment>
          <div className="row">
            <h2>CONTORl</h2>
            {list.map((val, i) => (
              <div
              //   className={`${column}`} key={i}
              >
                <InstagramEmbed
                  url={val.icon}
                  maxWidth={320}
                  hideCaption={false}
                  containerTagName="URL"
                  protocol=""
                  injectScript
                  onLoading={() => {}}
                  onSuccess={() => {}}
                  onAfterRender={() => {}}
                  onFailure={() => {}}
                />
              </div>
            ))}
          </div>
        </React.Fragment>
      </div>
    );
  }
}
